import React from 'react'

const cart = 
[ 
  {
    id: 1,
    className: 'cart',
    title: 'Adding products',
    input: <input />,
    button: <button>Order</button>,
    span: <span></span>
  }
]

const Cart = () => {
  return (
    <>
    {cart.map(({id, className,title, input, span, button}) => (
      <div key={id} className={className}>
        <h3>{title}</h3>
        {span}
        {input}
        {button}
      </div>
    ))}
    </>
  )
}

export default Cart
